import React, { useState } from 'react';

function CarForm({ onAddCar }) {
  const [car, setCar] = useState({ name: '', model: '' });

  const handleSubmit = (e) => {
    e.preventDefault();
    onAddCar(car);
    setCar({ name: '', model: '' });
  };

  return (
    <form onSubmit={handleSubmit}>
      {/* <input
        type="text"
        value={car.name}
        onChange={(e) => setCar({ ...car, name: e.target.value })}
        placeholder="Car Name"
        required
      />
      <input
        type="text"
        value={car.model}
        onChange={(e) => setCar({ ...car, model: e.target.value })}
        placeholder="Car Model"
        required
      /> */}
      <input type='text' value={car.name} onChange={(e)=> setCar({...car,name:e.target.value})} placeholder='Car Name'  required/>
      <input type='text' value={car.model} onChange={(e)=> setCar({...car,model:e.target.value})} placeholder='Car Modelz' required/>
      <button type="submit">Add Car</button>
      <button type='reset' onClick={handleReset()} value="Clear"/>
    </form>
  );
}

export default CarForm;
